// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awToolbarInternalRenderFunction } from 'js/AwToolbarInternalService';


/*
ctx imports
*/
import { getFirstCommandStates as firstCommandDisplays } from 'js/AwToolbarInternalService';
import { getSecondCommandStates as secondCommandDisplays } from 'js/AwToolbarInternalService';
const ctxImportObj = { firstCommandDisplays,secondCommandDisplays };


/*
dynamic import
 */
registerDynImportEntry('js/AwToolbarInternalService', () => import('js/AwToolbarInternalService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {
        "_overflownCommands": {},
        "_swfToolBarComponent": true
    },
    "actions": {
        "render": {
            "method": "awToolbarInternalRenderFunction",
            "deps": "js/AwToolbarInternalService",
            "options": {
                "elementRefList": [
                    "commandBarMain"
                ]
            }
        },
        "overflowPopup": {
            "actionType": "popup",
            "options": {}
        }
    },
    "ctx": {
        "firstCommandDisplays": {
            "parser": {
                "method": "getFirstCommandStates",
                "deps": "js/AwToolbarInternalService"
            }
        },
        "secondCommandDisplays": {
            "parser": {
                "method": "getSecondCommandStates",
                "deps": "js/AwToolbarInternalService"
            }
        }
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "i18n": {
        "MORE_LINK_TEXT": [
            "BaseMessages"
        ],
        "LESS_LINK_TEXT": [
            "BaseMessages"
        ],
        "NO_COMMANDS_TEXT": [
            "BaseMessages"
        ],
        "MORE_BUTTON_TITLE": [
            "BaseMessages"
        ]
    },
    "_viewModelId": "AwToolbarInternal",
    "_uniqueViewModelId": "AwToolbarInternal"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awToolbarInternalRenderFunction, {"elementRefList":["commandBarMain"]}, ctxImportObj );

export default Component;
